import React from 'react';
import * as style from "../../css/focusedList";

export default function Focused(props) {
  const renderFocusedList = () => {
    return props.focused.map((i, item) => {
      <div key={i}>{item}</div>
    })
  }

  console.log(props.focused)
  return (
    <div onClick={() => console.log(props.focused)} style={style.container}>
      {renderFocusedList()}
    </div>
  )
}
